n";i:0;s:8:"vod_hits";i:970;s:12:"vod_hits_day";i:246;s:13:"vod_hits_week";i:50;s:14:"vod_hits_month";i:10;s:12:"vod_duration";s:0:"";s:6:"vod_up";i:697;s:8:"vod_down";i:442;s:9:"vod_score";s:4:"10.0";s:13:"vod_score_all";i:2950;s:13:"vod_score_num";i:295;s:8:"vod_time";i:1563001708;s:12:"vod_time_add";i:1562999752;s:13:"vod_time_hits";i:0;s:13:"vod_time_make";i:0;s:10:"vod_trysee";i:0;s:13:"vod_douban_id";i:0;s:16:"vod_douban_score";s:3:"0.0";s:9:"vod_reurl";s:0:"";s:11:"vod_rel_vod";s:0:"";s:11:"vod_rel_art";s:0:"";s:7:"vod_pwd";s:0:"";s:11:"vod_pwd_url";s:0:"";s:12:"vod_pwd_play";s:0:"";s:16:"vod_pwd_play_url";s:0:"";s:12:"vod_pwd_down";s:0:"";s:16:"vod_pwd_down_url";s:0:"";s:11:"vod_content";s:2164:"世界最着名的无上装艳舞俱乐部、巴黎的“疯马”再度登上银幕由82岁的美国纪录片名导弗雷德里克‧韦斯曼执导的《疯马歌舞秀》威尼斯、多伦多和圣巴斯蒂安电影节上映。影片从年轻的舞蹈家PhilippeDecouflé被聘用为新节目编舞开始，向人们展示了“疯马”是如何运作的，以及从舞女到经理、看门大妈等形形色色的人物。韦斯曼是美国60年代“直接电影”运动的主要人物，他的镜头不流露主观性，并且摈弃了采访或者旁白，都是通过海量的拍摄素材在剪辑室里“诞生”一部电影。《疯马歌舞秀》也是这样，影片活色生香，让观众接受了一番美胸和大腿的洗礼，丝毫不会顾忌女权主义者的目光。1996年法国人自己也拍过一部纪录片《疯马秀》，该片因为有着后来走入了主流时尚界的蒂塔‧范‧提斯而值得特别的瞻仰。疯马俱乐部和旗下的代表节目裸体歌舞秀起源于1951年，以口味纯正的法式风格和浪漫艳舞而着称。其特色就是将裸体、灯光、布景、舞美相结合，营造出声、光、色、裸的“新境界”。关于疯马歌舞秀的纪录片有很多，从1977年开始，到2010年都有不少部关于歌舞秀和歌舞演员的纪录片和电视节目被制作出来。但是这些电视节目大多带有猎奇和纯粹记录的特色，制作相对粗糙。纪录片大师弗雷德里克‧怀斯曼这次拍摄的《疯马歌舞秀》是他的一部全新的纪录片。在这部纪录片中，弗雷德里克‧怀斯曼将放弃他在过去的四十年中长期使用的16mm的胶片带来的粗糙影像，他更换了摄影设备，使用了高清晰度的摄制装置。他的这种风格上的转变是为了捕捉到疯马歌舞秀在电光声上的美轮美奂和歌舞演员们的完美肉体而产生的。弗雷德里克‧怀斯曼一共在疯马俱乐部里呆了11周，他和他的摄影师约翰‧戴维进了一切可能，拍摄下了歌舞表演以及演员生活的方方面面。或许，这将成为怀斯曼拍摄过的最香艳的纪录片。";s:13:"vod_play_from";s:20:"zuidam3u8$$$subom3u8";s:15:"vod_play_server";s:7:"no$$$no";s:13:"vod_play_note";s:3:"$$$";s:12:"vod_play_url";s:123:"BD$https://eth.ppzuida.com/20181212/4719_dcb8713c/index.m3u8$$$HD高清$https://www.183757.com/20190311/XKdWH3Np/index.m3u8";s:13:"vod_down_from";s:0:"";s:15:"vod_down_server";s:0:"";s:13:"vod_down_note";s:0:"";s:12:"vod_down_url";s:0:"";s:4:"type";a:18:{s:7:"type_id";i:20;s:9:"type_name";s:6:"福利";s:7:"type_en";s:4:"fuli";s:9:"type_sort";i:5;s:8:"type_mid";i:1;s:8:"type_pid";i:0;s:11:"type_sta